    [],nt"revision_timestamp": "2016-04-18T19:38:18.396664",nt"name": "shrimp-survey-data",nt"isopen":
    false,nt"url": null,nt"notes": "The Northern Shrimp Survey was initiated
    in 1983 by the Atlantic States Marine Fisheries Commission (ASMFC) and monitors
    the relative abundance (number of shrimp), biomass (weight of shrimp),  and composition
     of the northern shrimp stock throughout the Gulf of Maine. The data give an understanding
    of year class strength and sex stage and maturity of shrimp in the population. The
    survey focuses its efforts in offshore waters (in depths greater than 50 meters)
    and is timed to sample both males and females during the summer when they are expected
    to be offshore. The data it collects forms the basis of the annual northern shrimp
    assessment, which in turn, is used by fishery managers from Maine, New Hampshire
    and Massachusetts to set each yearu00e2u0080u0099s fishing regulations.",nt"license_title":
